import './App.css';
import Login_Main from './components/login/login_main';
import Signup_Main from './components/signup/signup_main';
import {Switch, Router} from 'react-router-dom';

function App() {
  return (
    <>
    <Switch>
      <Route exact path='/' components='Signup_Main' />
      <Route exact path='login' components='Login_Main' />
    </Switch>
    {/* <Login_Main/> */}
    <Signup_Main/>
    </>
  );
}

export default App;
